__metaclass__ = type
from sffairmaker.qutil import *

def _dummyImage():
    size = 200
    im = QImage(size, size, QImage.Format_ARGB32)
    
    colors = list(map(QColor, """
        #DDD
        #666
        #F66
        #6F6
        #66F
        #FF3
        #F3F
        #3FF
    """.split()))
    
    bgColor = QColor("#F0F")
    textColor = QColor("#333")
    
    painter = QPainter(im)
    painter.setBackground(bgColor)
    painter.eraseRect(im.rect())
    
    w = h = size // (len(colors) + 2)
    for i, color in enumerate(colors):
        x = (i + 1) * w
        rc = QRect(x, h, w, size - 2 * h)
        painter.fillRect(rc, color)
    
    f = QFont("Decorative", 10)
    painter.setPen(textColor)
    painter.setFont(f)
    
    t1 = "this is 'BY DESIGN'."
    p1 = QRect(0, 0, size, size // 2)
    t2 = "この画像の追加は仕様です"
    p2 = QRect(0, size // 2, size, size // 2)
    
    for t, p in [(t1, p1), (t2, p2)]:
        painter.drawText(p, Qt.AlignCenter, t)
    painter.end()

    # Convert to Format_Indexed8
    im8 = QImage(size, size, QImage.Format_Indexed8)
    
    # Create a color table from the palette
    palette = [bgColor, textColor] + colors
    colorTable = [c.rgb() for c in palette]
    colorTable.extend([QColor(0, 0, 0).rgb()] * (256 - len(colorTable)))  # Fill the rest with black
    
    im8.setColorTable(colorTable)
    
    # Map the ARGB32 image pixels to Indexed8
    for x in range(im.width()):
        for y in range(im.height()):
            p = im.pixel(x, y)
            # QColorオブジェクトに変換して色を比較
            p_color = QColor(p)  # ARGBをQColorに変換
            i = colorTable.index(p_color.rgb())  # RGB値で検索
            im8.setPixel(x, y, i)
    
    # Save as BMP
    bmp_filename = os.path.join(os.getcwd(), "dummy_image.bmp")
    im8.save(bmp_filename, "BMP")
    print(f"Dummy image saved as {bmp_filename}")
    
    return im8

