# 動かないので諦めた
def dummyImageBK():
    global DummyImageBytes  # 外部の変数を使用するためにglobalを宣言
    qimage = QImage()
    
    # DummyImageBytesがstr型である場合のチェック
    if isinstance(DummyImageBytes, str):
        DummyImageBytes = DummyImageBytes.encode('utf-8')  # strからbytesに変換
    
    # bytes型としてloadFromDataを呼び出す
    success = qimage.loadFromData(DummyImageBytes, "BMP")
    
    if not success:
        print("Failed to load image")
    
    return qimage

# shinriyo完全置き換え
# Format_Indexed8のBMP画像を作成するコード
def dummyImage():
    size = 200
    # QImageの作成: 画像サイズとインデックスカラー形式を指定
    im = QImage(size, size, QImage.Format_Indexed8)

    # カラーパレットの設定（例: 白と黒の2色）
    color_table = [QColor(255, 255, 255), QColor(0, 0, 0)]  # 白と黒
    im.setColorTable([c.rgb() for c in color_table])

    # ピクセルデータの設定
    for x in range(size):
        for y in range(size):
            if (x + y) % 2 == 0:
                im.setPixel(x, y, 0)  # インデックス0: 白
            else:
                im.setPixel(x, y, 1)  # インデックス1: 黒

    return im  # QImageインスタンスを返す
